import './Navbar.css';
import logo from "../Assets/logo-white.png";
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <div className='navBar'>
      <img src={logo} alt="Logo" className="logo" />
      <ul>
        <li>
          <div className="login">
          <Link to="/login" className="button" activeClassName="active">Login</Link>
          </div>

        </li>x
        <li>
          <NavLink to="/signup" className="button gray" activeClassName="active">Sign Up</NavLink>
        </li>
      </ul>
    </div>


  );
}

export default Navbar;
